import React from 'react';
import './tour-card.css';
import {Link} from 'react-router-dom'

const TourCard = ({tour}) => {

    const {id, title, city, photo, price, featured, avgRating, reviews} = tour

  return (
    <div className="tour__card">
        <Card>
            <div className="tour__img">
                <span>Featured</span>
            </div>
        </Card>

        <CardBody>
            <div className="card__top d-flex align-item-center justify-content-between">
                <span className="tour__location d-flex align-item-center gap-1">
                    <i className="ri-map-pin-line"></i>{city}
                </span>
                <span className="tour__rating d-flex align-item-center gap-1">
                    <i className="ri-star-fill"></i>{avgRating}
                    <span>({reviews.length})</span>
                </span>
            </div>
            <h5 className="tour__title">
                <Link to={`/tours/${id}`}></Link>
            </h5>
        </CardBody>
    </div>
  );
}

export default TourCard;
